conds\r\n    Then I click onto the button \"Odmietnuť všetky\"\r\n\r\n    Then I see hyperlink for webelements\r\n      | Kontakty                                  |\r\n      | Asistenčné služby                         |\r\n      | Pobočky KOOPERATIVA                       |\r\n      | Stav mojej škody                          |\r\n      | Postup pri poistnej udalosti              |\r\n      | Dôležité dokumenty                        |\r\n      | Online platba poistného                   |\r\n      | Prihlásenie do klientskej zóny            |\r\n      | Asistenčné služby                         |\r\n      | Prvá appka na hlásenie poistných udalostí |\r\n      | Elektronická karta PZP (zelená karta)     |\r\n\r\n    And I don´t see these texts\r\n      | Zimný denník jedného auta: Môj náročný týždeň na cestách                    |\r\n      | Pokojné Vianoce začínajú doma. Chráňte to, na čom najviac záleží            |\r\n      | Menej papiera, viac zelene: Prečo sa oplatí prejsť na digitálnu komunikáciu |\r\n\r\n    Then Inside the block \"Auto\" I see hyperlinks\r\n      | Auto                            |\r\n      | Povinné zmluvné poistenie (PZP) |\r\n      | Auto komplet                    |\r\n      | MINI KASKO                      |\r\n      | AutoMat                         |\r\n      | GAP                             |\r\n\r\n    And Inside the block \"Život\" I see hyperlinks\r\n      | Život              |\r\n      | Profi invest       |\r\n      | Moja investícia    |\r\n      | Bezstarostný život |\r\n      | Nádej              |\r\n      | Variant Kapitál    |\r\n      | Dukátik            |\r\n      | Skoré uzdravenie   |\r\n      | Silencium          |\r\n      | Vodič plus         |\r\n      | Úrazové poistenie  |\r\n      | Pripoistenia       |\r\n\r\n    And Inside the block \"Majetok\" I see hyperlinks\r\n      | Majetok            |\r\n      | Bezstarostný domov |\r\n\r\n    And Inside the block \"Zodpovednosť\" I see hyperlinks\r\n      | Zodpovednosť                                                          |\r\n      | Zodpovednosť za škodu spôsobenú zamestnávateľovi pri výkone povolania |\r\n\r\n    And Inside the block \"Cestovanie\" I see hyperlinks\r\n      | Cestovanie                                     |\r\n      | MARCO POLO                                     |\r\n      | Objavuj Slovensko                              |\r\n      | Cestovné kancelárie poistené pre prípad úpadku |\r\n\r\n    And Inside the block \"Firmy a živnostníci\" I see hyperlinks\r\n      | Firmy a živnostníci                  |\r\n      | Biznis MAX                           |\r\n      | Podnikateľ                           |\r\n      | Poistenie profesijných zodpovedností |\r\n      | Enviro max                           |\r\n\r\n    And Inside the block \"Asistenčné služby\" I see hyperlinks\r\n      | Asistenčné služby |\r\n\r\n    And Inside the block \"Bankopoistenie\" I see hyperlinks\r\n      | Bankopoistenie |\r\n\r\n    And Inside the block \"Rýchle linky\" with highlighted header I see hyperlinks\r\n      | Kontakty             |\r\n      | Pobočky a servisy    |\r\n      | Kariéra              |\r\n      | Často kladené otázky |\r\n      | Fondy                |\r\n      | Klientsky portál     |\r\n      | Investičná stratégia |\r\n\r\n    And Inside the block \"Dôležité odkazy\" with highlighted header I see hyperlinks\r\n      | Dokumenty                      |\r\n      | Ochrana osobných údajov        |\r\n      | Informácie o používaní cookies |\r\n      | Postup podávania sťažností     |\r\n      | Partneri                       |\r\n      | Whisteblowing                  |\r\n      | Konflikt záujmov               |\r\n\r\n    And Verify all links are OK\r\n\r\n  @Regression @BasicFeatures1\r\n  Scenario: Testing basic verification of fields inside request for the information form\r\n    Given I visit the main website\r\n    When I click onto webelement \"Kontakty\"\r\n    And I click onto the button \"Odmietnuť všetky\"\r\n\r\n    Then I wait for 3500 milliseconds\r\n    And I click onto the button \"Cestovanie\"\r\n    And I click onto the button \"Žiadosti\"\r\n    And I click onto the button \"Žiadosť o zmenu v poistnej zmluve\"\r\n    Then I see the following fields\r\n      | Meno                                        |\r\n      | Číslo poistnej zmluvy \/ Číslo návrhu zmluvy |\r\n      | Dátum narodenia                             |\r\n      | Priezvisko                                  |\r\n      | Email                                       |\r\n      | Telefón                                     |\r\n      | Správa                                      |\r\n\r\n    Then I do not see the following fields\r\n      | IČO               |\r\n      | Názov spoločnosti |\r\n      | Zastupujúca osoba |\r\n\r\n    And I see the text area \"Správa\"\r\n\r\n    Then I select the radiobutton \"Spoločnosť\"\r\n\r\n    Then I see the following fields\r\n      | IČO                                         |\r\n      | Číslo poistnej zmluvy \/ Číslo návrhu zmluvy |\r\n      | Názov spoločnosti                           |\r\n      | Zastupujúca osoba                           |\r\n      | Email                                       |\r\n      | Telefón                                     |\r\n      | Správa                                      |\r\n\r\n    Then I do not see the following fields\r\n      | Meno            |\r\n      | Dátum narodenia |\r\n      | Priezvisko      |\r\n\r\n    But I see the text area \"Správa\"\r\n    Then I select the radiobutton \"Fyzická osoba\"\r\n    When I type \"Alex\" into the field \"Meno\"\r\n    Then field \"Meno\" has value \"Alex\"\r\n    When I type \" \" into the field \"Meno\"\r\n    Then I see validation message \"Meno je povinný údaj\"\r\n    When I type \"Alex\" into the field \"Meno\"\r\n    Then I do not see validation message \"Meno je povinný údaj\"\r\n\r\n    When I type \"Gregor\" into the field \"Priezvisko\"\r\n    Th enie prevádzky    |\r\n            | Prepätie alebo podpätie |\r\n\r\n        When I click onto next slide\r\n\r\n        Then I see articles\r\n            | Cudzie veci prevzaté |\r\n            | Regresy sociálnej a zdravotných poisťovní       |\r\n            | Spätné vystúpenie vody z kanalizačného potrubia |\r\n            | Čisté finančné škody                            |\r\n\r\n        When I click onto next slide\r\n        Then I see articles\r\n            | Škody na podzemných a nadzemných vedeniach |\r\n            | Búracie práce                              |\r\n\r\n        And I click onto the article \"Búracie práce\"\r\n        Then I see these texts\r\n            | Búracie práce                                               |\r\n            | Škody spôsobené búracími a demolačnými prácami bez použitia |\r\n            | Pripoistenie si môžete zriadiť k poisteniu zodpovednosti.   |\r\n\r\n        And I close this dialog\r\n        Then I don´t see these texts\r\n            | Škody spôsobené búracími a demolačnými prácami bez použitia |\r\n            | Pripoistenie si môžete zriadiť k poisteniu zodpovednosti.   |\r\n\r\n\r\n        And I click onto the article \"Škody na podzemných a nadzemných vedeniach\"\r\n        Then I see these texts\r\n            | Škody na podzemných a nadzemných vedeniach                                                                           |\r\n            | Fyzické poškodenie nadzemného alebo podzemného vedenia, napr. vodovody, kanalizácia, plynovody, optické káble a pod. |\r\n            | Pripoistenie si môžete zriadiť k poisteniu zodpovednosti.                                                            |\r\n\r\n        And I close this dialog\r\n        Then I don´t see these texts\r\n            | Fyzické poškodenie nadzemného alebo podzemného vedenia, napr. vodovody, kanalizácia, plynovody, optické káble a pod. |\r\n            | Pripoistenie si môžete zriadiť k poisteniu zodpovednosti.                                                            |\r\n\r\n        When I click onto previous slide\r\n        And I click onto the article \"Regresy sociálnej a zdravotných poisťovní\"\r\n        Then I see these texts\r\n            | Regresy sociálnej a zdravotných poisťovní                                                                                                                |\r\n            | Pripoistenie zodpovednosti pri pracovnom úraze zamestnanca. Zahŕňa aj náhradu nákladov za zdravotnú starostlivosť, nemocenské a dôchodkové zabezpečenie. |\r\n            | Pripoistenie si môžete zriadiť k poisteniu zodpovednosti.                                                                                                |\r\n\r\n        And I close this dialog\r\n        Then I don´t see these texts\r\n            | Pripoistenie zodpovednosti pri pracovnom úraze zamestnanca. Zahŕňa aj náhradu nákladov za zdravotnú starostlivosť, nemocenské a dôchodkové zabezpečenie. |\r\n            | Pripoistenie si môžete zriadiť k poisteniu zodpovednosti.                                                                                                |\r\n","uri":"cypress\\e2e\\features\\Biznis-max.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Testing Business-max","description":"","children":[{"scenario":{"id":"921e18c9-41e1-4b29-9437-d3d2583daf50","tags":[{"location":{"line":3,"column":5},"name":"@Regression","id":"a2766411-8a5b-4f8e-9d28-0c11b9f8f9f9"},{"location":{"line":3,"column":17},"name":"@BusinessMax","id":"362dc9f7-18b6-4af3-af35-9b4a2e20f79e"}],"location":{"line":4,"column":5},"keyword":"Scenario","name":"Verification of articles for business-max product","description":"","steps":[{"id":"54b0a5bd-0ce7-4999-9f62-8e17e874dfda","location":{"line":5,"column":9},"keyword":"Given ","keywordType":"Context","text":"I visit business-max product"},{"id":"162895b
